import React from 'react'

class TableRow extends React.Component {
    render() {
        var row = this.props.row;
        console.log(row)
        return (
            null
            /*<tr>
                {row.map(row => <td>{row.userId}</td>)}
            </tr>*/
        )
    }
}

export default TableRow
